INSERT INTO `coffees` (`cf_id`, `cf_code`, `cf_name`, `cf_desc`, `cf_roasted`, `cf_ingredients`, `cf_image`, `cf_category`, `cf_status`, `cf_campaign`, `deleted_at`, `cf_created_at`, `cf_updated_at`) VALUES
(1, 'ac-1', 'Americano Coffee', 'The Americano is another popular type of coffee drink, and it\'s very easy to make! It\'s just espresso with hot water dripping over it. The name came about during World War II when European baristas added water to their espresso drinks for the American soldiers stationed there. The resulting drink had a smoother, less concentrated flavour than espresso and thus the Americano was born.', 'Medium Roasted', 'Milk', 'coffeeImage/1.jpeg', 'americano', 1, 0, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:43'),
(2, 'ac-2', 'Americano Coffee', 'The Americano is another popular type of coffee drink, and it\'s very easy to make! It\'s just espresso with hot water dripping over it. The name came about during World War II when European baristas added water to their espresso drinks for the American soldiers stationed there. The resulting drink had a smoother, less concentrated flavour than espresso and thus the Americano was born.', 'Medium Roasted', 'Milk', 'coffeeImage/2.jpeg', 'americano', 1, 1, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:46'),
(3, 'ac-3', 'Americano Coffee', 'The Americano is another popular type of coffee drink, and it\'s very easy to make! It\'s just espresso with hot water dripping over it. The name came about during World War II when European baristas added water to their espresso drinks for the American soldiers stationed there. The resulting drink had a smoother, less concentrated flavour than espresso and thus the Americano was born.', 'Medium Roasted', 'Milk', 'coffeeImage/3.jpeg', 'americano', 1, 1, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:45'),
(4, 'bc-4', 'Black Coffee', 'Black coffee is arguably the most common type of coffee drink out there. Its popularity can be mainly attributed to how easy it is to make this beverage, be it drip, pour-over, French press, or anything else. Black coffee is usually served with no add-ins.', 'Medium Roasted', 'Milk', 'coffeeImage/4.png', 'affogato', 1, 1, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:45'),
(5, 'bc-5', 'Black Coffee', 'Black coffee is arguably the most common type of coffee drink out there. Its popularity can be mainly attributed to how easy it is to make this beverage, be it drip, pour-over, French press, or anything else. Black coffee is usually served with no add-ins.', 'Medium Roasted', 'Milk', 'coffeeImage/5.png', 'affogato', 1, 0, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:27'),
(6, 'bc-6', 'Black Coffee', 'Black coffee is arguably the most common type of coffee drink out there. Its popularity can be mainly attributed to how easy it is to make this beverage, be it drip, pour-over, French press, or anything else. Black coffee is usually served with no add-ins.', 'Medium Roasted', 'Milk', 'coffeeImage/6.png', 'affogato', 1, 0, NULL, '2024-10-23 09:13:51', '2024-11-10 14:50:27'),
(7, 'cc-7', 'Cappucchino', 'Cappuccinos are a classic Italian type of coffee drink made of espresso, steamed milk, and thick foam in equal parts. The name comes from the resemblance to the hoods worn by Capuchin monks. Making cappuccino is relatively easy and can be done at home too if you know how to make espresso.', 'Medium Roasted', 'Milk', 'coffeeImage/7.png', 'cappucchino', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(8, 'cc-8', 'Cappucchino', 'Cappuccinos are a classic Italian type of coffee drink made of espresso, steamed milk, and thick foam in equal parts. The name comes from the resemblance to the hoods worn by Capuchin monks. Making cappuccino is relatively easy and can be done at home too if you know how to make espresso.', 'Medium Roasted', 'Milk', 'coffeeImage/8.jpeg', 'cappucchino', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(9, 'cc-9', 'Cappucchino', 'Cappuccinos are a classic Italian type of coffee drink made of espresso, steamed milk, and thick foam in equal parts. The name comes from the resemblance to the hoods worn by Capuchin monks. Making cappuccino is relatively easy and can be done at home too if you know how to make espresso.', 'Medium Roasted', 'Milk', 'coffeeImage/9.png', 'cappucchino', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(10, 'es-10', 'Espresso', 'Espresso is made by forcing nearly boiling water through finely-ground coffee beans, which results in a concentrated, syrup-like coffee drink. This is the base for many Italian beverages in coffee shops. When compared to regular brewed coffee, espresso is much stronger than the other types of coffee drinks. Espressos are enjoyed in shots where a single shot is one ounce and a long (single and double) shot is two ounces in amount, respectively.', 'Medium Roasted', 'Milk', 'coffeeImage/10.png', 'espresso', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(11, 'es-11', 'Espresso', 'Espresso is made by forcing nearly boiling water through finely-ground coffee beans, which results in a concentrated, syrup-like coffee drink. This is the base for many Italian beverages in coffee shops. When compared to regular brewed coffee, espresso is much stronger than the other types of coffee drinks. Espressos are enjoyed in shots where a single shot is one ounce and a long (single and double) shot is two ounces in amount, respectively.', 'Medium Roasted', 'Milk', 'coffeeImage/11.png', 'espresso', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(12, 'es-12', 'Espresso', 'Espresso is made by forcing nearly boiling water through finely-ground coffee beans, which results in a concentrated, syrup-like coffee drink. This is the base for many Italian beverages in coffee shops. When compared to regular brewed coffee, espresso is much stronger than the other types of coffee drinks. Espressos are enjoyed in shots where a single shot is one ounce and a long (single and double) shot is two ounces in amount, respectively.', 'Medium Roasted', 'Milk', 'coffeeImage/12.png', 'espresso', 1, 1, NULL, '2024-10-23 09:13:51', '2024-11-14 20:30:02'),
(13, 'lt-13', 'Latte', 'A latte is an espresso with steamed milk and a dollop of milk foam on top. This beverage is more prevalent in America than other coffee drinks like cappuccinos because it contains less foam, making it smoother and gentler for those with sensitive palettes. And if you want to spice up your latte, add some flavouring syrup. To make an iced version of this drink, simply pour espresso and steamed milk over ice cubes.', 'Medium Roasted', 'Milk', 'coffeeImage/12.png', 'latte', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
(14, 'lt-14', 'Latte', 'A latte is an espresso with steamed milk and a dollop of milk foam on top. This beverage is more prevalent in America than other coffee drinks like cappuccinos because it contains less foam, making it smoother and gentler for those with sensitive palettes. And if you want to spice up your latte, add some flavouring syrup. To make an iced version of this drink, simply pour espresso and steamed milk over ice cubes.', 'Medium Roasted', 'Milk', 'coffeeImage/13.jpeg', 'latte', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
