(16, 'mc-16', 'Macchiato', 'The word \"macchiato\" means spotted, so a macchiato espresso is an espresso with a splash of milk. Most coffee shops will top off this type of coffee drink with some foamed milk instead of just steamed milk for what\'s known as a traditional macchiato.', 'Medium Roasted', 'Milk', 'coffeeImage/15.png', 'macchiato', 1, 0, NULL, '2024-10-23 09:13:51', '2024-10-23 09:13:51'),
