INSERT INTO `sss` (`sss_id`, `sss_title`, `sss_desc`, `sss_status`, `sss_order`, `deleted_at`, `sss_created_at`, `sss_updated_at`) VALUES
(1, 'Americano Nedir?', 'Americano, espresso üzerine sıcak su eklenerek hazırlanan bir kahve türüdür. Güçlü bir tat sunar.', 1, 1, NULL, '2024-10-28 05:34:05', '2024-11-09 22:05:15'),
(2, 'Espresso Nasıl Yapılır?', 'Espresso, ince çekilmiş kahve çekirdeklerinin yüksek basınçla demlenmesiyle elde edilir.', 1, 2, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(3, 'Latte ile Cappuccino Arasındaki Fark Nedir?', 'Latte, daha fazla süt ve az köpük içerirken, cappuccino eşit oranda espresso, süt ve köpükle hazırlanır.', 1, 3, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(4, 'Macchiato Nedir?', 'Macchiato, espresso üzerine birkaç damla süt eklenerek yapılan, yoğun kahve aroması taşıyan bir içecektir.', 1, 4, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(5, 'Hangi Kahve Hangi Durumda İçilir?', 'Espresso, hızlı bir enerji için; latte ise rahatlamak için idealdir.', 1, 5, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(6, 'Kahve Nasıl İyi Demlenir?', 'Kaliteli çekirdek, doğru su sıcaklığı ve demleme süresi, iyi bir kahve için gereklidir.', 1, 6, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(7, 'Kahve Farklı Boyutlarda Nasıl Sunulur?', 'Kahve boyutları, standart olarak küçük (ristretto), orta (espresso) ve büyük (americano) olarak sunulur.', 1, 7, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(8, 'Süt Alternatifleri Nelerdir?', 'Laktoz intoleransı olanlar için badem, soya ve yulaf sütü gibi alternatifler tercih edilebilir.', 1, 8, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(9, 'Kahve ile Şeker Oranı Nasıl Ayarlanır?', 'Tatlılık tercihinize göre şeker oranını artırabilir veya azaltabilirsiniz.', 1, 9, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(10, 'Kahve İle Eşleşen Atıştırmalıklar Neler?', 'Kahve, özellikle çikolata, bisküvi ve pasta gibi tatlılarla harika bir uyum sağlar.', 1, 10, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(11, 'Kahve Çekirdekleri Ne Zaman Kullanılmalıdır?', 'Kahve çekirdekleri, en taze haliyle 2-3 hafta içinde kullanılmalıdır.', 1, 11, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(12, 'Kahve Sıcak mı Yoksa Soğuk mu İçilmeli?', 'Kahve tercihleri kişiseldir; bazıları sıcak, bazıları soğuk kahve sever.', 1, 12, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(13, 'Kahve İle Sağlık Arasındaki İlişki Nedir?', 'Makul miktarda kahve tüketimi, bazı sağlık yararları sunabilir, ancak aşırıya kaçmamak önemlidir.', 1, 13, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(14, 'Kahve Yavaş mı Yoksa Hızlı mı İçilmeli?', 'Kahvenizi yudumlayarak içmek, tadını çıkarmanıza yardımcı olur.', 1, 14, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(15, 'Kahve Farklı Kültürlerde Nasıl Tüketilir?', 'Dünya genelinde kahve tüketim kültürleri oldukça farklıdır; her bölgenin kendine has yöntemleri vardır.', 1, 15, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(16, 'Kahve ve Çay Karşılaştırması', 'Kahve ve çay arasındaki tat, kafein oranı ve sağlık etkileri açısından önemli farklar vardır.', 1, 16, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(17, 'Kahve Tarifi İsterim!', 'Hangi tür kahve yapmak istediğinizi belirtin, size özel bir tarif sunalım!', 1, 17, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(18, 'Kahve Denemeleri', 'Farklı kahve türlerini denemek, damak tadınızı keşfetmenize yardımcı olur.', 1, 18, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(19, 'Kahve İle İlgili Eğlenceli Bilgiler', 'Kahve ile ilgili şaşırtıcı bilgiler ve mitler hakkında bilgi sahibi olun!', 1, 19, NULL, '2024-10-28 05:34:05', '2024-10-28 05:34:05'),
(20, 'Kahve ve Sanat', 'Kahve, barista sanatı ve latte sanatı gibi birçok yaratıcı ifade biçimini barındırır.', 1, 20, NULL, '2024-10-28 05:34:05', '2024-11-09 22:07:34'),
(21, 'Test Başlık', 'Test Açıklama', 0, 0, NULL, '2024-11-09 22:13:58', '2024-11-15 11:33:36');
